import React, { useState } from 'react';

const Home = () => {
  const [teamA, setTeamA] = useState('');
  const [kitA, setKitA] = useState('');
  const [teamB, setTeamB] = useState('');
  const [kitB, setKitB] = useState('');
  const [referee1, setReferee1] = useState('');
  const [referee2, setReferee2] = useState('');
  const [youtube, setYoutube] = useState('');

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-blue-50 flex flex-col items-center pt-16 px-2">
      {/* Logo ve Site İsmi */}
      {/* <div className="flex items-center mb-10">
        <img src="/logo192.png" alt="Logo" className="w-14 h-14 mr-4 drop-shadow-md" />
        <h1 className="text-3xl md:text-4xl font-bold text-blue-700 tracking-wide">Futbol Analiz</h1>
      </div> */}

      {/* Takımlar ve Hakemler */}
      <div className="w-full max-w-3xl bg-white rounded-2xl shadow-2xl p-8 flex flex-col gap-8">
        <div className="flex flex-col md:flex-row gap-6">
          {/* Takım A */}
          <div className="flex-1 bg-blue-50 rounded-xl p-6 shadow-md flex flex-col gap-4 border border-blue-100">
            <h2 className="text-lg font-semibold text-blue-700 mb-2 text-center">Takım A</h2>
            <label className="block text-gray-700 font-medium">Takım İsmi</label>
            <input
              type="text"
              value={teamA}
              onChange={e => setTeamA(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-400"
              placeholder="Takım A adı"
            />
            <label className="block text-gray-700 font-medium mt-2">Forma</label>
            <input
              type="text"
              value={kitA}
              onChange={e => setKitA(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-400"
              placeholder="Forma rengi/numarası"
            />
          </div>
          {/* Takım B */}
          <div className="flex-1 bg-green-50 rounded-xl p-6 shadow-md flex flex-col gap-4 border border-green-100">
            <h2 className="text-lg font-semibold text-green-700 mb-2 text-center">Takım B</h2>
            <label className="block text-gray-700 font-medium">Takım İsmi</label>
            <input
              type="text"
              value={teamB}
              onChange={e => setTeamB(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-400"
              placeholder="Takım B adı"
            />
            <label className="block text-gray-700 font-medium mt-2">Forma</label>
            <input
              type="text"
              value={kitB}
              onChange={e => setKitB(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-400"
              placeholder="Forma rengi/numarası"
            />
          </div>
        </div>
        {/* Hakemler */}
        <div className="flex flex-col md:flex-row gap-6">
          <div className="flex-1">
            <label className="block text-gray-700 font-semibold mb-1">Hakem 1</label>
            <input
              type="text"
              value={referee1}
              onChange={e => setReferee1(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-300"
              placeholder="Hakem 1 adı"
            />
          </div>
          <div className="flex-1">
            <label className="block text-gray-700 font-semibold mb-1">Hakem 2</label>
            <input
              type="text"
              value={referee2}
              onChange={e => setReferee2(e.target.value)}
              className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-300"
              placeholder="Hakem 2 adı"
            />
          </div>
        </div>
        {/* YouTube Linki */}
        <div>
          <label className="block text-gray-700 font-semibold mb-1">YouTube Linki</label>
          <input
            type="text"
            value={youtube}
            onChange={e => setYoutube(e.target.value)}
            className="w-full border border-gray-300 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-red-400"
            placeholder="YouTube video bağlantısı"
          />
        </div>
        {/* Özet Butonu */}
        <div className="flex justify-center mt-2">
          <button
            className="bg-gradient-to-r from-blue-600 to-green-500 hover:from-blue-700 hover:to-green-600 text-white font-bold py-3 px-12 rounded-full shadow-lg text-lg transition-all duration-200 transform hover:scale-105 focus:outline-none focus:ring-4 focus:ring-blue-200"
          >
            Özet
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
